import React from 'react';
import { useNavigate } from 'react-router-dom';
import "./MainPage.css";

function MainPage() {
  const navigate = useNavigate();

  const mainPageStyle = {
      backgroundImage: `url('LOTR Main Background.jpeg')`,
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
      backgroundPosition: 'center',
      height: '100vh',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center'
  };

  return React.createElement('div', { style: mainPageStyle }, 
      'Welcome to Our App!',
      React.createElement('button', { onClick: () => navigate('/login') }, 'Login'),
      React.createElement('button', { onClick: () => navigate('/create-account') }, 'Create Account')
  );
}

export default MainPage;
